import React, { Component } from "react";
import { Link} from "react-router-dom";

export class ListOfPeople extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            people: [],
            seq: props?.state?.seq,
            firstname: props?.state?.firstname,
            lastname: props?.state?.lastname,
            age: props?.state?.age,
            street: props?.state?.street,
            city: props?.state?.city,
            state: props?.state?.state,
            latitude: props?.state?.latitude,
            logitude: props?.state?.longitude,
            ccnumber: props?.state?.ccnumber,
            loading: true
        };

    }

    componentDidMount() {
        console.log(this.state);
        this.getPeople();
    }

    async getPeople(){
        const fetchPeople = await userService.fetchData('/peopleSearch?/');
        this.setState({equipments: fetchPeople, loading:false});
    }

    render() {
        return(
            <div>
            <br/><Link to="/"><button className={"btn btn-link"}>Tilbake til s√∏kesiden</button></Link>
            </div>
        )
    }

}
